import { LoginComponent } from "./FormLogin.components";
import './stylesForm.css'
export const FormLoginHtml = () => {
  const { context, setContext } = useContext(AuthContext);
  const { handleClick } = LoginComponent();
  return (
    <React.Fragment>
      <div className="items">
        <h4>Login</h4>
      </div>
      <div className="items">
        <form onSubmit={() => handleClick(setContext)}>
          <label>username</label>
          <div className="form-group">
            <input type="text" />
          </div>
          <label>password</label>
          <div className="form-group">
            <input type="text" />
          </div>
          <div className="form-group">
            <ButtonsPrimary type="submit" label="Sign in" />
          </div>
        </form>
      </div>
    </React.Fragment>
  );
};
